import "./App.css";
import { Routes, Route, Navigate } from "react-router-dom";
import Signup from "./components/Signup/Signup";
import Login from "./components/Login/Login";
import Home from "./components/Main/Home";
import Problem from "./components/Problem/Problem";
import CreateContest from "./components/Contest/CreateContest";
import AvailableContests from "./components/Contest/AvailableContests";
import ContestDetails from "./components/Contest/ContestDetails"; // Import the new component

function App() {
  const user = localStorage.getItem("token");
  return (
    <div className="App">
      <Routes>
        {user && <Route exact path="/home" element={<Home />} />}
        {user && <Route exact path="/problem/:id" element={<Problem />} />}
        {user && <Route exact path="/contest/create" element={<CreateContest />} />}
        {user && <Route exact path="/contest/available" element={<AvailableContests />} />}
        {user && <Route exact path="/contest/:id" element={<ContestDetails />} />} {/* New route for contest details */}
        <Route exact path="/signup" element={<Signup />} />
        <Route exact path="/login" element={<Login />} />
        <Route exact path="/" element={<Navigate replace to="/login" />} />
      </Routes>
    </div>
  );
}

export default App;
